import React from "react";
import styled from "styled-components";
import { Button } from "react-bootstrap";
import "bootstrap/dist/css/bootstrap.min.css";

const Ticket = () => {
  return (
    <Container>
      <div className="flex column">
        <img
          src="https://external-preview.redd.it/qKqDBJXUFlCGtmXyMd3YKnEXvMkv0DRTvH1h7RQe-FU.jpg?auto=webp&s=3a00ebfc084ae73836088232c50069cca9c90631"
          alt=""
        />
      </div>
      <div className="jadwal mb-5">
        <h2>14 November 2022</h2>
        <Button className="jam" variant="secondary">
          12.03
        </Button>{" "}
        <Button className="jam" variant="secondary">
          13.10
        </Button>{" "}
        <Button className="jam" variant="secondary">
          14.25
        </Button>{" "}
        <Button className="jam" variant="secondary">
          15.30
        </Button>{" "}
        <Button className="jam" variant="info">
          17.00
        </Button>{" "}
        <Button className="jam" variant="info">
          19.10
        </Button>{" "}
        <Button className="jam" variant="info">
          20.20
        </Button>{" "}
      </div>
      <hr />
      <div className="jadwal">
        <h2>15 November 2022</h2>
        <Button className="jam" variant="info">
          11.10
        </Button>{" "}
        <Button className="jam" variant="info">
          13.00
        </Button>{" "}
        <Button className="jam" variant="info">
          14.40
        </Button>{" "}
        <Button className="jam" variant="info">
          16.00
        </Button>{" "}
        <Button className="jam" variant="info">
          17.10
        </Button>{" "}
        <Button className="jam" variant="info">
          18.40
        </Button>{" "}
      </div>
      <hr />
      <div className="jadwal">
        <h2>16 November 2022</h2>
        <Button className="jam" variant="info">
          10.05
        </Button>{" "}
        <Button className="jam" variant="info">
          13.10
        </Button>{" "}
        <Button className="jam" variant="info">
          15.25
        </Button>{" "}
        <Button className="jam" variant="info">
          16.40
        </Button>{" "}
        <Button className="jam" variant="info">
          17.50
        </Button>{" "}
        <Button className="jam" variant="info">
          18.40
        </Button>{" "}
        <Button className="jam" variant="info">
          20.10
        </Button>{" "}
      </div>
      <hr />
    </Container>
  );
};

const Container = styled.div`
  img {
    height: 30rem;
  }
  .jadwal {
    margin: auto;
    margin-top: 15px;
    font-size: 1.1rem;
    margin-bottom: 30px;
    align-items: center;
    .jam {
      margin-top: 15px;
      font-size: 25px;
      width: 90px;
      height: 40px;
      margin-right: 20px;
    }
  }
`;

export default Ticket;

